import React from 'react';
import './Dashboard.css'; // Import a CSS file for styling if needed

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <div className="card">
        <h2>Short term Goal</h2>
        <p>Level up from Intermediate to Advance level SDR.</p>
      </div>
    </div>
  );
};

export default Dashboard;
